script: |
  super -f text -I q1267.spq | sort > q1267.out

inputs:
  - name: q1267.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE + col0 * + col1 NOT BETWEEN + col1 - + col0 AND - 97 + 49 * col1;
  - name: tab1

outputs:
  - name: q1267.out
    data: |
      51	14	96
      85	5	59
      91	47	68
